//      return(
//         <div>
//             <Router path="/" component={Home} />

//         </div>>
//      );
//  }
function App(){
    return(
        <div>
            <Router exact path="/" component={Home} />
            <Router exact path="/login" component={Login} />
        
        </div>
    )
}
export default App
